import '../App.css';
import { useState } from 'react';
import Note from ''

function App() {
  const [notes, setNotes] = useState([])

  for (const note of notes) {
    const noteComponent = <Note content={note}/>
  }

  return (
    <div className="App">
      {notes}
    </div>
  );
}

export default App;
